import React, { Component } from 'react';
import TextField from '@mui/material/TextField';





const SignIn = () => {
   
    return (
      <div>
      <TextField
  sx={{

    width: { sm: 250, md: 350 },
    margin: 50,
    "& .MuiOutlinedInput-root": {
      "& > fieldset": {
        borderColor: "orange"
      }
    }
  }}

  variant="outlined"
/>
      </div>
    )
  
}

export default SignIn;
